const menu = [
  {
    key: "/index",
    title: "首页",
    icon: "home",
    subs: [
      { title: "工作台", key: "/index/workflow", icon: "form" },
      { title: "分析页", key: "/index/analysis", icon: "bar-chart" }
    ]
  },
  { title: "基础表单", key: "/form", icon: "form" },
  { title: "表格", key: "/table", icon: "pie-chart" }
];

export default menu;
